import React, { useState } from 'react';

const ShopDropdown = () => {
  const [open, setOpen] = useState(false);
    const handleClose = () => setOpen(false);
    const handleShow = () => setOpen(true);

  const colStyle = {
    flex: 1,
    borderRight: '1px solid #ccc',
    padding: '1rem',
    minWidth: '160px'
  };
  const colStyle1 = {
    flex: 1,
    borderRight: '1px solid #ccc',
    padding: '1rem',
    minWidth: '100px'
  };
  const colStyle2 = {
    flex: 1,
    borderRight: '1px solid #ccc',
    padding: '1rem',
    minWidth: '450px'
  };
  return (
    <div>
      <div
        onDoubleClick={handleClose}
        onClick={handleShow}
        style={{ cursor: 'pointer' }}
      >
         <span>SHOP</span>
        {open && (
          <div
            style={{
              position: 'absolute',
              top: '100%',
              left: 0,
              width: '100vw',
              backgroundColor: '#fff',
              color: '#000',
              display: 'flex',
              borderTop: '1px solid #ccc',
              zIndex: 999,
              flexWrap: 'wrap'
            }}
          >
            <div style={colStyle1}>
              <strong>Shop All →</strong>
            </div>
            <div style={colStyle}>
              <strong>ORAL CARE</strong>
              <div>Toothpaste Bits Fluoride-Free</div>
              <div>Toothpaste Bits with Fluoride</div>
              <div>Mouthwash Bits</div>
              <div>Whitening Gel</div>
              <div>Floss</div>
              <div>Toothbrush</div>
              <div>Tongue Scraper</div>
            </div>
            <div style={colStyle}>
              <strong>BODY CARE</strong>
              <div>Deodorant</div>
              <div>Body Balm</div>
            </div>
            <div style={colStyle}>
              <strong>SETS</strong>
              <div>Daily Habits Kit</div>
              <div>Clean Essentials Duo</div>
              <div>Everyday Whitening System</div>
              <div>Best of Bite</div>
              <div>Travel Kit</div>
            </div>
            <div style={{ ...colStyle2, borderRight: 'none' }}>
              <strong>OUR BEST SELLERS</strong>
              <div style={{ display: 'flex', gap: '1rem', marginTop: '1rem' }}>
                <div>
                  <img src="https://bitetoothpastebits.com/cdn/shop/files/desktop-nav-tout-bits.jpg?v=1699977611&width=375" alt="Toothpaste" style={{ width: '100px' }} />
                  <div>Shop Toothpaste Bits →</div>
                </div>
                <div>
                  <img src="https://bitetoothpastebits.com/cdn/shop/files/desktop-nav-tout-deo.jpg?v=1699977611&width=375" alt="Deodorant" style={{ width: '100px' }} />
                  <div>Shop Deodorant →</div>
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default ShopDropdown;
